                    <li>macrespo</li>
                    <button id="play-button-1" onClick={routeChange}>Play !</button>
                </ul>
            </div>
            <br></br>
            <div  id="welcome--video-div">
                    <video autoPlay loop muted src={video1} id="welcome--video-video" height="200px"/>
            </div>        
            <Footer />
        </div>
        </>
    )
}
